    public TerrainEdit(
        ref List<Chunk> _allActiveChunks, 
        TerrainData _terrainData,
        ref ConcurrentQueue<Chunk> _chunkWaiteForNative,
        Camera _fpsCam
    )
    {
        digRequests = new Queue<DigData>();
        changeRequests = new Queue<ChangeRequest>();

        allActiveChunks = _allActiveChunks;
        terrainData = _terrainData;
        chunkWaiteForNative = _chunkWaiteForNative;
        oneDim = terrainData.segemntCountPerDimension + 1;
        fpsCam = _fpsCam;
    }

    public struct ChangeRequest
    {
        public List<Vector3> points;
        public List<float> strengths;
        public Chunk chunk;
        public Vector3 chunkLoc;
    }

    public struct DigData
    {
        public bool add;
        public Vector3 digPos;
        public Vector3 chunkPos;
        public Vector3 triggerDirection;
    }

    string StringVector(Vector3 vec)
    {
        return (vec.x.ToString() + "_" + vec.y.ToString() + "_" + vec.z.ToString());
    }

    bool xIsDown = false;

    // Update is called once per frame
    public void Update()
    {
        if (Input.GetKey(KeyCode.X))
        {
            xIsDown = true;
        } else
        {
            xIsDown = false;
        }

        ProcessDigChangeRequests();
        ProcessChangeRequests();
    }

    public void ProcessChangeRequests()
    {
        if (changeRequests.Count > 0)
        {
            ChangeRequest changeRequest = changeRequests.Dequeue();


            Chunk chunk = allActiveChunks.SingleOrDefault(x => x.position == changeRequest.chunkLoc);

            // Debug.Log(StringVector(changeRequest.chunkLoc));

            if (chunk != null)
            {
                chunk.commandQueue.Enqueue(() => {

                    ThreadDataRequest.RequestData(() =>
                    {
                        int i = 0;

                        for (i = 0; i < changeRequest.points.Count; i++)
                        {
                            var point = changeRequest.points[i];
                            var strength = changeRequest.strengths[i];
                            int chunkEditPointId = (int)(point.x + point.y * oneDim + point.z * oneDim * oneDim);

                            float newStr = chunk.strengths[chunkEditPointId] + strength;

                            if (chunkEditPointId < 0 || chunkEditPointId >= oneDim * oneDim * oneDim)
                            {
                                Debug.Log("Invalid index");
                            }

                            if (newStr > 0.999f)
                            {
                                newStr = 1f;
                            } else if (newStr < 0.1f)
                            {
                                newStr = 0f;
                            }

                            if (strength < 0 && newStr < 0.5f)
                            {
                                newStr = 0f;
                            }

                            chunk.strengths[chunkEditPointId] = newStr;

                            if (chunkEditPointId > chunk.strengths.Count)
                            {
                                Debug.Log(chunkEditPointId.ToString() + "_" + chunk.strengths.Count.ToString() + "_ProcessChangeRequests");
                            }
                        }


                        if (false && xIsDown)
                        {
                            //string playerToJson = JsonUtility.ToJson(chunk.strengths.ToArray());
                            //Debug.Log(playerToJson);
                            //Debug.Log(chunk.strengths.ToString());

                            //string fuu = "{";
                            //float[] wasd = chunk.strengths.ToArray();

                            //for (int x = 0; x < wasd.Length; x++)
                            //{
                            //    wasd[x] *= 1;
                            //}

                            

                            //string s = "{" + string.Join(", ", (wasd).ToArray()) + "}";

                            //Debug.Log(s);

                            //File.WriteAllText("D://Test.txt", s);

                            //Debug.Log("####" + chunk.strengths.Count.ToString());
                        }

                        //chunk.strengths = fromFile.ToList();

                        chunk.nextStep = PopulateNativeStrengths;
                        chunk.state = Chunk.State.WaitingNative;
                        chunkWaiteForNative.Enqueue(chunk);

                        return chunk;
                    }, (object _chunk) =>
                    {
                        Chunk chunk = (Chunk)_chunk;

                    });
                });
            }
        }
    }

    void PopulateNativeStrengths(Chunk chunk)
    {
        chunk.state = Chunk.State.FillingStrengths;
        chunk.chunkNativeData.strengths.CopyFrom(chunk.strengths.ToArray());
        chunk.state = Chunk.State.Interpreting;
        chunk.InterpretStrengths(chunk);
    }

    public void ProcessDigChangeRequests()
    {
        if (digRequests.Count > 0)
        {
            DigData digData = digRequests.Dequeue();

            Vector3 chunkL = digData.chunkPos;
            chunkL.x = digData.chunkPos.x / terrainData.smallestChunkWidth;
            chunkL.y = digData.chunkPos.y / terrainData.smallestChunkWidth;
            chunkL.z = digData.chunkPos.z / terrainData.smallestChunkWidth;

            //Debug.Log(StringVector(chunkL));

            Chunk chunk = allActiveChunks.SingleOrDefault(x => x.position == chunkL);

            if (chunk == null)
            {
                Debug.Log("Click on non existing chunk:" + StringVector(chunkL));
                return;
            }

            ThreadDataRequest.RequestData(() =>
            {
                ProcessDigVolume(digData, chunkL, chunk);
                //ProcessDigChangeRequestsPart(digData, chunkL, chunk);
                return chunk;
            }, (object _chunk) =>
            {
                Chunk chunk = (Chunk)_chunk;
            });
        }
    }


    void ProcessDigVolume(DigData digData, Vector3 chunkL, Chunk chunk)
    {
        float effectR = digBallR;

        List<Vector3> meshPoints = new List<Vector3>();
        List<Vector3> chunkLocs = new List<Vector3>();
        List<float> strengths = new List<float>();
        Vector3 currentPoint = Vector3.zero;

        Vector3 localAbsolutePoint = digData.digPos - (digData.chunkPos - Vector3.one * chunk.chunkR * terrainData.smallestChunkWidth);
        Vector3 unrounded = localAbsolutePoint / (chunk.chunkR * 2f * (terrainData.smallestChunkWidth / (float)terrainData.segemntCountPerDimension));

        Vector3 chunkGridPoint = Vector3.zero;

        chunkGridPoint.x = Mathf.RoundToInt(unrounded.x);
        chunkGridPoint.y = Mathf.RoundToInt(unrounded.y);
        chunkGridPoint.z = Mathf.RoundToInt(unrounded.z);

        //Debug.Log(StringVector(localAbsolutePoint) + " # " + StringVector(digData.digPos) + " # " + StringVector(digData.chunkPos));

        for (float i = -effectR; i <= effectR; i++)
        {
            for (float j = -effectR; j <= effectR; j++)
            {
                for (float k = -effectR; k <= effectR; k++)
                {
                    currentPoint.x = chunkGridPoint.x + k;
                    currentPoint.y = chunkGridPoint.y + j;
                    currentPoint.z = chunkGridPoint.z + i;

                    chunkLocs.Add(chunkL);
                    meshPoints.Add(currentPoint);

                    //strengths.Add(GetChangeStrength(chunk, currentPoint, (digData.add ? 1 : -1)));
                    strengths.Add(GetDigStrength(chunkGridPoint, currentPoint, effectR) * (digData.add ? 1 : -1));
                }
            }
        }

        Dictionary<Vector3, ChangeRequest> changeRequestDictionary = new Dictionary<Vector3, ChangeRequest>();

        for (int i = 0; i < meshPoints.Count; i++)
        {
            Vector3 meshPoint = meshPoints[i];
            Vector3 chunkLoc = chunkLocs[i];

            while (meshPoint.x < 0)
            {
                meshPoint.x += terrainData.segemntCountPerDimension;
                chunkLoc.x -= 2f;
            }

            while (meshPoint.y < 0)
            {
                meshPoint.y += terrainData.segemntCountPerDimension;
                chunkLoc.y -= 2f;
            }

            while (meshPoint.z < 0)
            {
                meshPoint.z += terrainData.segemntCountPerDimension;
                chunkLoc.z -= 2f;
            }

            while (meshPoint.x >= terrainData.segemntCountPerDimension)
            {
                meshPoint.x -= terrainData.segemntCountPerDimension;
                chunkLoc.x += 2f;
            }

            while (meshPoint.y >= terrainData.segemntCountPerDimension)
            {
                meshPoint.y -= terrainData.segemntCountPerDimension;
                chunkLoc.y += 2f;
            }

            while (meshPoint.z >= terrainData.segemntCountPerDimension)
            {
                meshPoint.z -= terrainData.segemntCountPerDimension;
                chunkLoc.z += 2f;
            }

            N_RecursiveAddToChangeRequest(changeRequestDictionary, chunkLoc, meshPoint, strengths[i]);
        }

        foreach (var changeRequest in changeRequestDictionary)
        {
            changeRequests.Enqueue(changeRequest.Value);
        }
    }

