    void N_RecursiveAddToChangeRequest(Dictionary<Vector3, ChangeRequest> changeRequestDictionary, Vector3 chunkLoc, Vector3 meshPoint, float strength)
    {
        AddThing(changeRequestDictionary, chunkLoc, meshPoint, strength);

        if (meshPoint.x == 0)
        {
            N_RecursiveAddToChangeRequest(
                changeRequestDictionary,
                new Vector3(chunkLoc.x - 2, chunkLoc.y, chunkLoc.z),
                new Vector3(meshPoint.x + terrainData.segemntCountPerDimension, meshPoint.y, meshPoint.z),
                strength
            );
        }

        if (meshPoint.y == 0)
        {
            N_RecursiveAddToChangeRequest(
                changeRequestDictionary,
                new Vector3(chunkLoc.x, chunkLoc.y - 2, chunkLoc.z),
                new Vector3(meshPoint.x, meshPoint.y + terrainData.segemntCountPerDimension, meshPoint.z),
                strength
            );
        }

        if (meshPoint.z == 0)
        {
            N_RecursiveAddToChangeRequest(
                changeRequestDictionary,
                new Vector3(chunkLoc.x, chunkLoc.y, chunkLoc.z - 2),
                new Vector3(meshPoint.x, meshPoint.y, meshPoint.z + terrainData.segemntCountPerDimension),
                strength
            );
        }
    }

    void AddThing(Dictionary<Vector3, ChangeRequest> changeRequestDictionary, Vector3 chunkLoc, Vector3 meshPoint, float strength)
    {
        ChangeRequest changeRequest;

        if (changeRequestDictionary.ContainsKey(chunkLoc))
        {
            changeRequest = changeRequestDictionary[chunkLoc];
        }
        else
        {
            changeRequest = new ChangeRequest();
            changeRequest.strengths = new List<float>();
            changeRequest.points = new List<Vector3>();
            changeRequest.chunkLoc = chunkLoc;

            changeRequestDictionary.Add(chunkLoc, changeRequest);
        }

        if (!changeRequest.points.Contains(meshPoint))
        {
            //if (xIsDown &&
            //    (
            //        meshPoint.x > 30 || meshPoint.y > 30 || meshPoint.z > 30 ||
            //        meshPoint.x < 0 || meshPoint.y < 0 || meshPoint.z < 0 ||
            //        strength < 0 || strength > 1
            //    )/* && strength != 0*/)
            //{
            //    Debug.Log(StringVector(meshPoint) + " # " + strength.ToString());
            //}

            changeRequest.points.Add(meshPoint);
            changeRequest.strengths.Add(strength);
        }
    }

    float GetDigStrength(Vector3 originPoint, Vector3 targetPoint, float range)
    {
        //return 1f;

        //System.Random random = new System.Random();

        //return (float)random.NextDouble();
        
        float distBP = Vector3.Distance(originPoint, targetPoint) / range;

        if (distBP > 1)
        {
            return 0;
        }

        float distBPR = 1 - distBP;
        float newV = distBPR * distBPR;

        if (newV < 0.0001)
        {
            return 0;
        } else if (newV > 0.9999)
        {
            return 1f;
        }

        return newV;
    }

