    Vector3 GetChunk(Vector3 point)
    {
        int x = Mathf.RoundToInt(point.x / (terrainData.smallestChunkWidth));
        int y = Mathf.RoundToInt(point.y / (terrainData.smallestChunkWidth));
        int z = Mathf.RoundToInt(point.z / (terrainData.smallestChunkWidth));

        if (x == 0) { x += point.x > 0 ? 1 : -1; }
        if (y == 0) { y += point.y > 0 ? 1 : -1; }
        if (z == 0) { z += point.z > 0 ? 1 : -1; }

        return new Vector3(x, y, z);
    }

